import React, { Component } from 'react';
import "antd/dist/antd.css";
import "../css/Layout-profile.css"
import { Row, Col, Avatar, Tabs, Button, List } from 'antd';

import { Navbar, Form, FormControl, Container } from 'react-bootstrap';

import axios from 'axios';

import { Link } from "react-router-dom";

class LayoutProfile extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        const TabPane = Tabs.TabPane;
        const data = [
            {
                title: 'Ant Design Title 1',
            },
            {
                title: 'Ant Design Title 2',
            },
            {
                title: 'Ant Design Title 3',
            },
            {
                title: 'Ant Design Title 4',
            },
        ];
        return (
            <div>
                <Container>
                    <Row>
                        <Col lg={4}>
                            <Avatar size={128} icon="user" />
                        </Col>
                        <Col lg={14}>
                            <div className="userData mt-4">
                                <h2 className="d-block" style={{ fontSize: "1.5rem", fontWeight: "bold" }}>
                                    <a href="#">Some Name</a>
                                </h2>
                                <h6 className="d-block">
                                    <a href="#">1,500</a>
                                    Video Uploads
                                </h6>
                                <h6 className="d-block">
                                    <a href="#">300</a>
                                    Blog Posts
                                </h6>
                            </div>
                        </Col>
                    </Row>
                    <Row>
                        <Col>
                            <Tabs type="card">
                                <TabPane tab="Information user" key="1">

                                    <ul class="list-group list-group-flush">
                                        <li class="list-group-item">
                                            <Row >
                                                <Col md={4} lg={5}>
                                                    <label className="font-weight-bold">Full Name</label>
                                                </Col>
                                                <Col md={20} lg={19}>
                                                    <span>Jamshaid Kamran</span>
                                                </Col>
                                            </Row>
                                        </li>
                                        <li class="list-group-item">
                                            <Row >
                                                <Col md={4} lg={5}>
                                                    <label className="font-weight-bold">Full Name</label>
                                                </Col>
                                                <Col md={20} lg={18}>
                                                    <span>Jamshaid Kamran</span>
                                                </Col>
                                            </Row>
                                        </li>

                                    </ul>
                                </TabPane>

                                <TabPane tab="Tab 2" key="2">
                                    <List
                                        itemLayout="horizontal"
                                        dataSource={data}
                                        renderItem={item => (
                                            <List.Item>
                                                <List.Item.Meta
                                                    avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
                                                    title={<a href="https://ant.design">{item.title}</a>}
                                                    description="Ant Design, a design language for background applications, is refined by Ant UED Team"
                                                />
                                            </List.Item>
                                        )}
                                    />
                                </TabPane>
                                <TabPane tab="Tab 3" key="3">
                                    <p>hihi</p>
                                    <p>hihi</p>
                                    <p>hihi</p>
                                    <p>hihi</p>
                                    <p>hihi</p>
                                </TabPane>
                            </Tabs>
                        </Col>
                    </Row>
                </Container>


                {/*<Container>*/}
                {/*<Row >*/}
                {/*<Col lg={24}>*/}
                {/*<div className="card">*/}
                {/*<div className="card-body">*/}
                {/*<div className="card-title mb-4">*/}
                {/*<div className="d-flex justify-content-start">*/}
                {/*<div className="image-container">*/}
                {/*<img src="http://placehold.it/150x150" id="imgProfile"*/}
                {/*style={{width: "150px", height: "150px"}} className="img-thumbnail"/>*/}
                {/*<div className="middle">*/}
                {/*<input type="button" className="btn btn-secondary"*/}
                {/*id="btnChangePicture" value="Change"/>*/}
                {/*<input type="file" style={{display: "none"}} id="profilePicture"*/}
                {/*name="file"/>*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*<div className="userData ml-3">*/}
                {/*<h2 className="d-block" style={{ fontSize: "1.5rem", fontWeight: "bold"}}>*/}

                {/*<a href="#">Some Name</a>*/}
                {/*</h2>*/}
                {/*<h6 className="d-block">*/}
                {/*<a href="#">1,500</a>*/}
                {/*Video Uploads</h6>*/}
                {/*<h6 className="d-block">*/}
                {/*<a href="#">300</a>*/}
                {/*Blog Posts*/}
                {/*</h6>*/}
                {/*</div>*/}
                {/*<div className="ml-auto">*/}
                {/*<input type="button" className="btn btn-primary d-none" id="btnDiscard"*/}
                {/*value="Discard Changes"/>*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*<div className="row">*/}
                {/*<div className="col-12">*/}
                {/*<ul className="nav nav-tabs mb-4" id="myTab" role="tablist">*/}
                {/*<li className="nav-item">*/}
                {/*<a className="nav-link active" id="basicInfo-tab" data-toggle="tab"*/}
                {/*href="#basicInfo" role="tab" aria-controls="basicInfo"*/}
                {/*aria-selected="true">Basic Info</a>*/}
                {/*</li>*/}
                {/*<li className="nav-item">*/}
                {/*<a className="nav-link" id="connectedServices-tab" data-toggle="tab"*/}
                {/*href="#connectedServices" role="tab"*/}
                {/*aria-controls="connectedServices" aria-selected="false">Connected*/}
                {/*Services</a>*/}
                {/*</li>*/}
                {/*</ul>*/}
                {/*/!*<div className="tab-content ml-1" id="myTabContent">*!/*/}
                {/*/!*<div className="tab-pane fade show active" id="basicInfo"*!/*/}
                {/*/!*role="tabpanel" aria-labelledby="basicInfo-tab">*!/*/}
                {/*/!*<div className="row">*!/*/}
                {/*/!*<div className="col-sm-3 col-md-2 col-5">*!/*/}
                {/*/!*<label style="font-weight:bold;">Full Name</label>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="col-md-8 col-6">*!/*/}
                {/*/!*Jamshaid Kamran*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<hr/>*!/*/}

                {/*/!*<div className="row">*!/*/}
                {/*/!*<div className="col-sm-3 col-md-2 col-5">*!/*/}
                {/*/!*<label style="font-weight:bold;">Birth Date</label>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="col-md-8 col-6">*!/*/}
                {/*/!*March 22, 1994.*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<hr/>*!/*/}
                {/*/!*<div className="row">*!/*/}
                {/*/!*<div className="col-sm-3 col-md-2 col-5">*!/*/}
                {/*/!*<label style="font-weight:bold;">Something</label>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="col-md-8 col-6">*!/*/}
                {/*/!*Something*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<hr/>*!/*/}
                {/*/!*<div className="row">*!/*/}
                {/*/!*<div className="col-sm-3 col-md-2 col-5">*!/*/}
                {/*/!*<label style="font-weight:bold;">Something</label>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="col-md-8 col-6">*!/*/}
                {/*/!*Something*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<hr/>*!/*/}
                {/*/!*<div className="row">*!/*/}
                {/*/!*<div className="col-sm-3 col-md-2 col-5">*!/*/}
                {/*/!*<label style="font-weight:bold;">Something</label>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="col-md-8 col-6">*!/*/}
                {/*/!*Something*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<hr/>*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*<div className="tab-pane fade" id="connectedServices" role="tabpanel"*!/*/}
                {/*/!*aria-labelledby="ConnectedServices-tab">*!/*/}
                {/*/!*Facebook, Google, Twitter Account that are connected to this account*!/*/}
                {/*/!*</div>*!/*/}
                {/*/!*</div>*!/*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*</div>*/}
                {/*</Col>*/}
                {/*</Row>*/}
                {/*</Container>*/}
            </div>
        )
    }
}

export default LayoutProfile;
